style.css:
body {
    /* Set background image */
    background-image: url(https://64.media.tumblr.com/746ea0e6ae7a9c44d9b698f8e1212346/1cb44ddcb1c852c2-d8/s640x960/e035f119830ff0b420cc413e37fbec6020ce8c3b.pnj);
    
    /* Set background image to cover entire viewport */
    background-size: cover;

    /* Center the background image */
    background-position: center;

    /* Optional: Add a background color in case the image is not fully visible */
    background-color: #FD666A; /* Replace with desired color */
}
